import React from 'react';

const Profile = () => {
  return (
    <>
      <div className="max-w-md mx-auto bg-white rounded-xl shadow-md overflow-hidden md:max-w-2xl">
        <div className="md:flex">
         
          <div className="p-8">
            <div className="uppercase tracking-wide text-sm text-indigo-500 font-semibold">Case Study</div>
            <a href="#" className="block mt-1 text-lg leading-tight font-medium text-black hover:underline">Finding customers for your new business</a>
            <p className="mt-2 text-slate-500">Getting a new business off the ground is a challenging and delicate process. Here are some tips to help you find your first customers.</p>
            <div className="mt-4">
              <h2 className="text-lg font-medium">User  Information</h2>
              <p className="text-sm text-slate-500">Username: <span className="font-semibold">johnDoe</span></p>
              <p className="text-sm text-slate-500">Email: <span className="font-semibold">johndoe@example.com</span></p>
              <button className="bg-red-500 hover:bg-red-700 text-white font-bold py-2 px-4 rounded">Logout</button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Profile;
